var activities = {};
var weekns = [];

for (var i = 0; i < events.length; i++) {
	var weekn = moment.utc(events[i].start).week();

	if (_.indexOf(weekns, weekn) == -1) {
		weekns.push(weekn);
	}

	var activity;

	if (events[i].name.startsWith("Behani")) {
		activity = "beh" + moment.utc(events[i].start).day();
	} else if (events[i].name.startsWith("Brigada 1")) {
		activity = 'brig1';
	} else if (events[i].name.startsWith("Brigada 2")) {
		activity = 'brig2';
	} else if (events[i].name.startsWith("Brigada 3")) {
		activity = 'brig3';
	} else if (events[i].name.startsWith("Brigada 4")) {
		activity = 'brig4';
	} else if (events[i].name.startsWith("Fitness")) {

		// aid 54, 62
		switch(events[i].activity_id) {
			case 54:
			activity = 'fit1';
			break;
			case 62:
			activity = 'fit2';
			break;
			default:
			activity = 'fit3'
			break;
		}
		
	} else if (events[i].name.startsWith("Obed")) {
		activity = "obed" + moment.utc(events[i].start).day();
	}else if (events[i].name.startsWith("Spol 1")) {
		activity = 'spol1';
	} else if (events[i].name.startsWith("Spol 2")) {
		activity = 'spol2';
	} else if (events[i].name.startsWith("Spol 3")) {
		activity = 'spol3';
	} else if( events[i].name.startsWith("Cesta domu")) {
		activity = 'cesta1';
	}else if (events[i].name.startsWith("Cesta na kolej")) {
		activity = 'cesta2';
	} 

	if (activity == undefined)
		continue;

	if (!(activity in activities)) {
		activities[activity] = {};	
	}

	activities[activity][weekn] = events[i];
	
};
